//////////////////////////////////////////////////////////////////////
// Purpose: SiteMap Component
// Author: Siddharth Karanchery
//////////////////////////////////////////////////////////////////////
import React from "react";

import "./SiteMap.css";

function SiteMap() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
  return <div className="SiteMap">SiteMap</div>;
}
export default SiteMap;
